import React from 'react';
import '../stylesheets/home.css';
import { ReactReduxContext } from 'react-redux'




function Home() {
    return (
        <ReactReduxContext.Consumer>
        <div className="home">
            <ol>
                {({store}) => store.map(i => {
                    <li>{i}</li>
                })}
            </ol>

        </div>
        </ReactReduxContext.Consumer>
    );
}

export default Home;
